import React from 'react';
import TodoListItem from './TodoListItem';
import styled from 'styled-components';

const TodoList = () => {
  return (
    <div>
      <TodoLists>
        <TodoListItem />
        <TodoListItem />
        <TodoListItem />
      </TodoLists>
    </div>
  );
};

export default TodoList;

const TodoLists = styled.div``;
